          <img
            src="./uploads/events/default-event.jpg"
            alt="event"
            width="1000vh"
          />
        </SwiperSlide>
        <SwiperSlide>
          <img
            src="./uploads/events/default-event.jpg"
            alt="event"
            width="1000vh"
          />
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Carousel;
